"Jums leidus, „OnePlus“ rinks informaciją apie jūsų telefono naudojimą, kad pagerintų produkto dizainą ir naudotojo patirtį. Jei sutinkate prisijungti prie naudotojo patirties programos („programos), vadinasi, sutinkate, kad „OnePlus“ rinktų, naudotų ir analizuotų šią informaciją:
 (1) konfigūracijos duomenis;
 (2) statistinius taikomosios programos duomenis;
 (3) naudotojo elgesio duomenis.
 Rinkdama ir analizuodama minėtus duomenis, „OnePlus“ siekia pagerinti naudotojų patirtį, pavyzdžiui, padidinti baterijos efektyvumą ir sistemos stabilumą. Visos procedūros „OnePlus“ atliekamos anonimiškai ir koduotai. Šie duomenys neatskleidžia jūsų asmeninės informacijos. Prisijungę prie programos iš jos išeiti galėsite bet kuriuo metu šiuo būdu: Parametrai – Išplėstinės – Naudotojo patirties programa ir pašalinę varnelę nuo langelio. Daugiau apie „OnePlus“ apdorojamą informaciją sužinosite „OnePlus“ privatumo politikoje. Atsisakius programos, „OnePlus“ nustos rinkti prieš tai minėtą informaciją apie jus."
